    encoded_message = ''

    for char in message:
        if char.isalpha():
            if char in vowels:
                if char.lower() == 'a':
                    encoded_message += 'C'
                elif char.lower() == 'e':
                    encoded_message += 'G'
                elif char.lower() == 'i':
                    encoded_message += 'K'
                elif char.lower() == 'o':
                    encoded_message += 'Q'
                elif char.lower() == 'u':
                    encoded_message += 'Y'
                else:
                    char_index = ord(char) + 2
                    if char.isupper():
                        encoded_message += chr(char_index - 26).upper()
                    else:
                        encoded_message += chr(char_index)
            else:
                encoded_message += char.swapcase()
        else:
            encoded_message += char

    return encoded_message
