def compare_one(a, b):
    if type(a) != type(b):
        return max(a, b)
    elif a == b:
        return None
    else:
        if isinstance(a, int) or isinstance(a, float):
            return max(a, b)
        elif isinstance(a, str):
            if '.' in a or ',' in a:
                a = float(a.replace(",", "."))
            if '.' in b or ',' in b:
                b = float(b.replace(",", "."))
            return str(max(float(a), float(b)))

# Test cases
